  ('Bokobé', 'antrop.', NULL, NULL, NULL, NULL, 'relacionado con bOkobbe o con kObbe. Está loca lizado en Batete. bókijbia, v. trabajar, faenar, labrar; n la i ibari trabajo mañana, lo billo ibba n tyí''a la pasado mañana no trabajo. Pret. bókobiia, bókobiesiia. bókijbiera, v. trabajar para, servir; iilo biityii a la le - esta persona trabaja para mí. Pret. bóko bieriia, bókobieresiia. bókijbieresiia, pret. v. o bókobiera ; tii bii - ii biitukuáari trabajábamos para la alcaldesa. bókijbieriia, pret. v. o bókobiera ; a abiibée ba tyi''a - a apanná los bubis no trabajaron para los blancos. bókijbiesiia, pret. v. o bókobia ; tii ello ii liihebbO trabajábamos el día de descanso. bókijbiia, pret. v. o bókobia ; ii - ii buéá bii á maityi traba jaste el mes de agosto', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Bokobó', 'antrop.', NULL, NULL, NULL, NULL, 'que debería escribirse BiikiibO y presenta dos significados. En primer lugar está relacionado con K6bo. En segun do lugar lo podemos relacionar también con k6bo. En este último caso se escribirá Biikiibo. Está localizado en Batete. Bokochí, antrop. que se refiere a alguien con un taparrabo o a una hIerba amarga y comes tible. En lengua bubi debería escribirse Biikiityí. También significa botella o termo. Está localiza do en Baney. bokussú / 123', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('bokoé', 's.', NULL, NULL, 'Cl. 1', NULL, 'sing. criado, bracero, extranjero. . Tb. bOkiJllé', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
