  ('Bolota', 'antrop.', NULL, NULL, NULL, NULL, 'obtenido a partir del verbo o lotta. BOIotta se refiere a la persona que vigi la. Se localiza en Bakake', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
