  ('Bomabá', 'antrop.', NULL, NULL, NULL, NULL, 'obtenido a partir de bOmma y bá. Se refiere a alguien que está sobre la ceiba. Está localizado en Baney. Bomaho [bomáoj. antrop. obtenido a partir del ver bo o báa. Boma''o se referirá a alguien que construye. Está localizado en Basaka to de la Sagrada Familia, en Basupú y en Bakake', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
