  ('Buiyabán', 'antrop.', NULL, NULL, NULL, NULL, 'construido a partir de buía y o iábanna. Este antropóni mo puede traducirse por "exceso, resto". Está localizado en Rebola. bukessi, pret. v. o bukka ; n-a batyo e ehMma wela hacía cosquillas a las personas en la oscu ridad. bukessi, pret. v. o bukká ; m abundaba, o - abundabas, a - abundaba, etc. ; i bonní i - el dinero abundaba. búkessi, pret. v. o búkka ; IÍlmalé i - i pókkó antaño abunda ban los bueyes. bukiesiia, pret. v. o bukkiáa ; a abieri ba - a bOllá e erüa wela los nacimientos incrementaban el número de niños en el pueblo', NULL, 'tekessi', 'Fuente: bubi-español', 'import-script'),
  ('bukká', 's.', NULL, NULL, NULL, NULL, 'sing. agujero. nicho. el. 3. Tb. bOlló. bukka, v. hacer cosquillas. Pret. bukki, bukes si. bukká, 1. v. abundar. 2. sobrar. Pret. bukkí, bukessi. búkka, v. abundar; o tuáppo to lá sélla 0 ripottb las tien das abundan mucho en la ciudad. Pret. búkki, búkessi. bukki, pret. v. o bukka ; o bulla a la ooatooa kóri o bo - la doncella se ríe porque le hice cosquillas. búkki, pret. v. o búkka ; i kóllá ¡-e esubba las lluvias abun d a n en la época lluviosa. bukki, pret. v. o bukká ; m - abun dé, o - abundaste, a - abundó, etc. ; i tyokko i - e etúllá wela a Bioko el dinero abunda en la isla de Bioko. bukkia, pret. v. o bukkiáa ; e kbbinna a - e beobbo be a batyo el gobierno aumentó los sueldos de la gente. bukkiáa, v. acrecentar, incrementar, aumen tar; o mmásalÍl a la - e ripeám ri áó mi jefe aumenta nuestra paga. Pret. bukkía, bukiesiia', NULL, 'o tekka', 'Fuente: bubi-español', 'import-script'),
  ('bukkio', 's.', NULL, NULL, NULL, NULL, 'pI. ronquidos. el. 6', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('bukku', 's.', NULL, NULL, NULL, NULL, 'sing. selva. el. 3. Tb. bu''u', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Bula', 'antrop.', NULL, NULL, NULL, NULL, 'obtenido a partir del verbo o bulla. Bulla se refiere a alguien que defiende o protege, o a la doncella casadera 142 / nuhí que VIW lodavía su periodo IIlICláhco. Está loca lizado en Moka', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Bulá', 'antrop.', NULL, NULL, NULL, NULL, 'que significa "tormenta" o "tempes tad". Bullá se aplica a aquella persona bastante f uerte. Está localizado en Balachá, Belebú y Moeri', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Bulabaté', 'antrop.', NULL, NULL, NULL, NULL, 'formado a partir del verbo o bulla y del sustantivo batté. Bulabaté se aplica a la persona que defiende los árboles. Está localizado en Rebola', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('bulabulla', 's.', NULL, NULL, 'Cl. 3', NULL, 'sing. 1. mes de octubre. 2. tempes tad. . bulaelessi, pret. v. o bulaella ; n - defendía, o - defendías, a - defendía, to - defendíamos, 10 - defendíais, ba - defendían. bulaella, v. defender, proteger; to la - e bilabba bi áó defendemos nuestros asuntos tradicionales. Pret. bulaem, bulaelessi. bulaem, pret. v. o bulaella ; n - e tyóbbo o bOieo) defendí la casa de mi padre', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
