  ('bule''o', 'S.', NULL, NULL, 'Cl. 6', NULL, 'pi. tapones de corcho. ; a - bá e bekoteri los tapones de corcho de las botellas. bulea, V. salvarse, defenderse; alebbáa a la alo a pa''a lá cada uno se defiende como puede, n ta pityi o - no pude defenderme. Pret. bulei, buleseei', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Bulebiele', 'antrop.', NULL, NULL, NULL, NULL, 'formado a partir del verbo o bulla y de la expresión Melle. Bullebe''ele se traducirá por "defensor de quien llo ra por algo". Está localizado en Belebú y Ruiché. Buleché, antrop. obtenido a partir del verbo o bulla y el sustantivo e tyé. Buletyé se aplica a quien defiende el poblado o el país. Está locali zado en Balachá. bulei, pret. v. o bulea ; n me salvé, o - te salvaste, a - se salvó, to - nos salvamos, 10 os salvasteis, ba - se salvaron. bulelessi, pret. V. o bulella ; n a batyo ba ta okkí ba bekutta yo abrigaba a las per sonas que no tienen mantas. bulella, V. abrigar, proteger; n la - o botyolÍl protejo ami pariente. Pret. buleri, bulelessi. buleri, pret. V. o bulella ; n bo o boyolla IÍI yo abri gué a mi abuelo. buleseei, pret. V. o bulea ; n - me salvaba, o - te sal vabas, a - se salvaba, to - nos salvábamos, 10 - os salvabais, ba - se salvaban. bulessi, pret. V. o bulla ; a bakuerakueráa ba - a basoppo los alumnos se disputaban los panes. bulessi, pret. v. o bulláa ; n e tya', NULL, NULL, 'Fuente: bubi-español', 'import-script');

