  ('Bureleke', 'antrop.', NULL, NULL, NULL, NULL, 'obtenido a partir del verbo o buráa y eleke. Debería escri birse Buréleke. Está localizado en Riaba. buresiia, pret. v. o buráa ; n i i tyallálÍl mandaba aguje rear mis chapas de zinc; 10 - a bo''á vosotros calentabais el agua salada. burl, pret. v. o bulla ; o le - la o to''ú o, la o buétáa o me salvaste con tu fuerza, con tu inteli gencia. buría, pret. v. o buráa ; e rokútta a - tooa el médico hizo reír; m - a boppé o yo calenté tu agua. buríi, pret. v. o bulláa ; e etélÍl emmaa n e - toda la olla lo agujereé', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
