  ('Dikuasa', 'antrop.', NULL, NULL, NULL, NULL, 'que hace referencia a alguien que endereza algo ya torcido. Se localiza en Baloeri. dinaebbia, v. negar; iile) botyo a la - a labba lammaa esta persona niega todas las cosas. Pret. dinaebiia, dinaebiesiia. dinaebiesiia, pret. v. o dinaebbia ; tO - a labba lammaa nosotros negábamos todas las cosas', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
