  ('hololló', 'adj.', NULL, NULL, 'Cl. 16', NULL, 'sing. viejo, veterano, antiguo. Con cuerda con las palabras de la ; a habba - el lugar antiguo. horn, pret. V. o hOa ; a boppé ba - el agua está fria. Tb. ho;. homa, V. calmarse, tranquilizarse; we bOrne! ¡no te calmes! Pret. hOmi, hOmessi. homessi, pret. V. o hOma ; 0-elo ebari te tranqui lizabas esta mañana. horni, pret. V. o hOma ; n - me tranquilicé, o - te tranquilizaste, a - se tran 188 / hOmia quilzó, to - nos tranquilizamos, 10 - os tranquili zasteis, ba - se tranquilzaron. homia, v. calmar, tranquilizar; o - e ekokko calmar la cabeza, tranquilizarse. hOótibbia, v. cazar; e sipóssi si lá - e etyíó el gato caza de noche. Pret. hóñtibi ia, hóÍltibiesi ia. hOótibiesiia, pret. v. o hóÍltibbia ; o obébá a - e ebarityio el cazador cazaba por la mañanita. hoótibiia, pret. v. o hoÍltibbia ; e sipóssi si - o obitya el gato cazó al ratón. hoom, pret. v. o holláa ; n quiero, o - quieres, a - quiere, to - queremos, lo - queréis, ba - quieren; n-a baísso Ól quiero a mis mujeres. hora, v. vo', NULL, 'o hoa', 'Fuente: bubi-español', 'import-script'),
  ('hotee', 'adj.', NULL, NULL, 'Cl. 16', NULL, 'grande, voluminoso, importante. Con cuerda con las palabras de la ; a habba - el lugar importante. hótelessi, pret. v. o hótella ; o biiieÓl a - ii boka''ó mi padre revolvía la verdura. hótella, v. agitar, revolver, falsear; n la - e etéÓl yo revuelvo la olla. Pret. hótem, hótelessi. hótem, pret. v. o hótella ; ne - e etéÓl revolví el contenido de la olla. hótyi / 189 hótera, v. cambiar, modificar, transformar; to la na''a o - e bilabba que remos cambiar las cosas, we bi hótere e bilabba no cambies las cosas. Pret. hóteriia, hóteresiia. hóteresiia, pret. v. o hótera ; to ri - e ribotyo nosotros cambiá bamos la vida. hóteriia, pret. v. o hótera ; ba bO - o boatta ellos modificaron la historia. hótessi, pret. v. o hótta ; e emaókoro e -la e húé el man go maduraba con el calor, e bireótya bi - la e ebélló las naranjas maduraban con el tiempo. hótOlessi, pret. v. o hótolla ; n-yo des hilaba, o - tú deshilabas, a - él deshilaba, to nosotros deshilábamos, 10 - vosotros deshilabais, ba - ellos ', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('hotottó', 'adj.', NULL, NULL, NULL, NULL, 'blanco, color claro; botyo bo - per sona blanca; luua 10 - vestido blanco', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('hótóttó', 'adj.', NULL, NULL, NULL, NULL, 'blanco, blanca, blancos, blancas. Con cuerda con las palabras de las Cls. 9 y 10; oabba - animal blanco, koppá - tiburones blancos. hótta, v. 1. quedar limpio; na bo oOi o bokut ta bO Já - si lavas la manta queda limpio. 2. madurar; e biObbé bi lá - bakassO las atan gas maduran pronto. Pret. hótyi, hótessi. hotya, v. increpar fuertemente; o mmásam a la le - mi jefe me incre pa fuertemente. Pret. hótyia, hotyesiia. hótya, v. 1. chapear, desbrozar, segar. Pret. hótyi, hótyessi. 2. blanquear. Pret. hótyia, hó tyesiia. hótyálessi, pret. v. o hótyálla ; to isaké nosotros chapeába mos con machete. hótyálla, v. chapear con, desbrozar con, etc. ; a batyo ba Já - e beoe be ábo la gente chapea con sus dedos. Pret. hótyám, hótyálessi. hótyám, pret. v. o hótyálla ; a batyo bá''a bua''á bá ba - a bello bábil las personas que van a morir chapearon con sus dientes. hótyelessi, pret. v. o hótyella ; 0 o botúkku yo chapeaba para el alcalde, n ta - o botúkku yo no chapeaba para el alcalde. hótyella, v. ch', NULL, 'pret', 'Fuente: bubi-español', 'import-script'),
  ('húbbé', 's.', NULL, NULL, NULL, NULL, 'sing. ladrón, caco. Cls. 9 y 10 ; we - eres un ladrón, e - e húbiia el ladrón escapó. húbbia, v. correr, huir, desertar; e bihólOlló bi lá - las rameras huyen. Pret. húbiia, húbiesiia. húbiera, v. huir de, escapar de; a batyo ba lá - e bittá la gente huye de la guerra, o la o - yo huyo de ti, o la le ? ¿huyes de mí? Pret. húbieriia, húbieresiia. húbieresÍÍa, pret. v. o húbiera ; o o - yo huía de ti, o le - tú huías de mí, a - e bittá él huía de la guerra, to - e tyallá nosotros huíamos del hambre, vosotros huíais de noso 10 e tros, ba e - ellos huían de nosotros. húbieriia, pret. v. o húbiera ; e iporosía bi - a batyo ba hMmotyi ba basaké los policías huyeron de las personas que llevaban machetes. húbiesÍÍa, pret. v. o húbbia ; o - yo huía, o - tú huías, a - él huía, to - nosotros huía mos, 10 - vosotros huíais, ba - ellos huían. húbiia, pret. v. o húbbia ; e pókkó é le poe a batyo bá - el buey, al llegar a las perso nas huyeron', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('húé', 's.', NULL, NULL, NULL, NULL, 'sing. calor, caliente, cálido. Clases 9 y 10', NULL, 'wía', 'Fuente: bubi-español', 'import-script'),
  ('huehue', 's.', NULL, NULL, 'Cl. 9', NULL, 'sing. y pI. calor, caliente. y 10. huelessi, pret. v. o huella ; e aríolla oe - e bikokkó bi áe a la ancIana le arrancaba sus plantas de malanga. huelessi, pret. v. o huella ; e neppóm oe - a mi sobrino le aconsejaba. huella, v. arrancar de la tierra para alguien; to la - o bulla bekokkó nosotros arrancamos tubérculos de malanga para la doncella. Pret. hueri, huelessi. huella, v. aconsejar, persuadir, orientar; o boyolla a la - a baseseppe el anciano aconseja a los jóvenes. Pret. huem, huelessi. huelOlessi, pret. v. o huelolla ; n o bulla yo desaconsejaba a la doncella. hueloUa, v. desaconsejar; o boie a la - a baseseppe el hombre desaconseja a los jóvenes. Pret. huelori, huelolessi. o bo huelOri, pret. v. o huelolla ; o bulla a la doncella le desaconsejé. huem, pret. v. o huella ; o oberíim a le - mi madre me aconsejó, o booatú''om a ta le - mi hermano mayor no me aconsejó', NULL, 'húé', 'Fuente: bubi-español', 'import-script'),
  ('hueuóko', 's.', NULL, NULL, NULL, NULL, 'sing. tibio. Cls. 9 y 10 ; a boppé be - el agua está tibia. hueri, pret. v. o huella ; o bo - e rikobbe o botyo le arranqué la planta del plátano a la persona. huessi, pret. v. o huua ; to ba - a batté nosotros arrancá bamos los árboles, to ta bá - a batté no arrancábamos los árboles. húkalessi, pret. v. o húkalla ; o bo - o waísso m yo abra zaba a mi mujer. húkalla, v. abrazar. Pret. húkari, húkalessi; le abrázame; we le - no me abraces; -bo abrázale; we bo -le no le abraces. húkari, pret. v. o húkalla ; oe le anne labba n te - o oberíi m no recuerdo haber abrazado a mi madre. húkessi, pret. v. o húkka ; n-yo abro chaba, o tú abrochabas, a él abrochaba, to nosotros abrochábamos, 10 - vosotros abrocha bais, ba - ellos abrochaban. húkka, v. abrochar; e bobbé e lá - e torosís si o boyolla el nieto abrocha el pantalón del abuelo. Pret. húkki, húkessi. hútyi / 191 húkki, pret. v. o húkka ; o ta bo - o botiio no has abrochado el botón. húlessi, pret. v. o hulla ; e rial lá ri áí ri - su man', NULL, 'o ukalla, o hátyibia', 'Fuente: bubi-español', 'import-script'),
  ('huitító', 's.', NULL, NULL, 'Cl. 3', NULL, 'sing. ruido. molestia. ', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('húúa', 's.', NULL, NULL, NULL, NULL, 'sing. público gente, muchedumbre, multitud. el. 10. huua, v. arrancar de la tierra; a baísso ba e e biheJÍI bi ábo yo domestico el caballo. Pret. i''i, i''essi. i''essi, pret. v. o i''a ; o opotto - e eossi el blanco domaba al caballo. i''i, pret. v. o i''a ; i póríi kubbaa to i - todas las cabras las domamos. iáa, v. ir a la finca, al trabajo; o bokoé a la el bracero acude al trabajo. Pret. ií, iessi. iálessi, pret. v. o iálla ; to a baloari ayudábamos a los impedidos. iálla, v. ayudar, socorrer, asistir, colaborar con alguien; e kobinna e lá - o tobólló el gobierno ayuda a los pobres. Pret. iári, iálessi. iám, pret. v. o iálla ; elo ebari n-o botyo a epatto lÍl esta mañana ayudé a mi ve cino. iári, pret. v. iálla ; mpári m bo - o botyo bullé ayer le ayudé a la otra persona', NULL, 'o otyáa', 'Fuente: bubi-español', 'import-script'),
