  ('íIIa', 's.', NULL, NULL, 'Cl. 5', NULL, 'sing. 1. nombre, honor. ; ká ri he e - o? ¿cuál es tu nombre? ¿cómo te llamas? 2. voz, nombre, pala bra. . Tb. iUáa', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
