  ('Iíkelíke', 'adJ.', NULL, NULL, NULL, NULL, 'pI. muchos, muchas, abundantes. C fr. líke. 10, prono sujo vosotros, vosotras; - tyi nabba lue betyo vosotros no sois animales, sois personas. lo, mori dem. este, a; ri - rikekko ké raalÍl esta mejilla es mía. ló, asim. de lé y o. Significa todavía, aún; ne lé o obOtyo estoy todavía en el mundo, ne - o báám estoy todavía en la finca. 10''0, s. sing. acuerdo. CI. 1 1; o hella - ponerse de acuerdo', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
