  ('lokákka', 's.', NULL, NULL, 'Cl. 6', NULL, 'sing. cangrejo pequeño de mar. Cl. I I. lokalessi, pret. v. o 10kalla ; a abitábítta ba - a basesepári bá e eriia wela los militares se acostaban con las jóvenes del pueblo. lokalla, v. dormir con, acostarse con, fornicar, chingar; n la - bibbo duermo con demonios. Pret. lokam, lokalessi. lokam, pret. v. o lokanna ; n bo - o bObbelÍ1 me acosté con mi marido. lokanessi, pret. v. o lokruma ; a - bi''ó él dormía con fiebre. lokanna, v. dormir con, acostarse con. Pret. lokam, lokanessi', NULL, 'o lokanna', 'Fuente: bubi-español', 'import-script'),
