  ('Lola', 'antrop.', NULL, NULL, NULL, NULL, 'que debería escribirse Lóllá. Se localiza en Rebola', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('lolda', 's.', NULL, NULL, NULL, NULL, 'sing. sábado. CI. 9. loldesiia, pret. v. o lokkia ; o botúkku a - a batyo ba e ripelló el alcalde alojaba a las personas de la fiesta', NULL, 'sátiré', 'Fuente: bubi-español', 'import-script'),
  ('lóllá', 's.', NULL, NULL, 'Cl. 1', NULL, 'sing. lluvia. Cl. II. Tb. wellá. Ej. expr. - a tyí oppáa tyóbbo alo té la lluvia no cae delante de una sola casa. IOlIá, v. pacer, pastar; i pókkó i lá - los bueyes pacen. Pret. lorí, lolessi. 10110, s. sing. planta del ñame, ñamal. 1 ; á me tárí o - eteppe wela ? ¿quién medió la planta del ñame en la pared? IOpello / 225', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
