  ('Lolo', 'antrop.', NULL, NULL, 'Cl. 1', NULL, 'que puede escribirse Limo o Lolló. Se localiza en Baloeri y en Baoey. 1010, adj. dem. este, esta. Concuerda con los nom bres de la 1; - IOlIó esta pierna, - IOnekku esta hierba mora. 1010''0, s. sing. muralla. muro de contención, barrera. 1. 100óa, s. sing. mortero. 1', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('lololló', 'adj.', NULL, NULL, NULL, NULL, 'sing. viejo, veteraoo. Concuerda con las palabras de la CI. 6b; a labba - los viejos asuntos. 100ólló, adj. sing. viejo, veteraoo. Concuerda con las palabras de la CI. 1 1; o luua - el viejo ves tido', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Lomopuá', 'antrop.', NULL, NULL, NULL, NULL, 'que debería escribirse Lom mopuá. Parece haberse construido a partir de rimmo. En este sentido se referirá a una persona sumamente her mosa. Se localiza en Batoicopo y basupú', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('lonekku', 's.', NULL, NULL, NULL, NULL, 'sing. verdura amarga. hierba mora. Cl. I I. Tb. lona''u', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
