  ('Lubá', 'antrop.', NULL, NULL, NULL, NULL, 'que se refiere al mimbre de la pal ma. Lubbá fue el nombre del Jefe o bOtúkku de San Carlos, quien luchó contra los colonizadores españoles y murió en 1910. Este antropónimo se localiza en Batoicopo y en Bocoricho', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
