  ('mmembó''o', 's.', NULL, NULL, NULL, NULL, 'sing. suegra. el. I. mmenna, pret. v. o Ólmera ; e le lelelle o boie m bo - cuando me llamó el señor le con esté. mmera, v. contestar, responder; - le tyíi contéstame, por favor, we bO mmere no le contestes. Pret. mmenna, mme resiia. mmeresiia, pret. v. o Ólmera ; n-yo contestaba, o - tú contestabas, a - él contestaba, to - nosotros contestábamos, lo vosotros contestabais, ba - ellos contestaban. mmeri, pret. o ommella ; e kobinna e - a batyo el gobierno ha representado a la gente', NULL, 'oberlbó''o', 'Fuente: bubi-español', 'import-script'),
  ('mmeri', 's.', NULL, NULL, NULL, NULL, 'sing. madre, señora. el. 1. mmessi, pret. v. o mma ; n obo''ó yo me ponía de pie. mmetessi, pret. v. o Ólmetta ; n yo cogía, o - tú cogías, a - él cogía, to - noso tros cogíabamos, 10 - vosotros cogíais, ba - ellos cogían. mmetta, v. coger, detener; a batyo ba lá o lobakka las personas cogen el ataúd. Pret. mmetyi, mme tessi', NULL, 'mmé', 'Fuente: bubi-español', 'import-script'),
  ('mmetya', 's.', NULL, NULL, NULL, NULL, 'sing. burlón, bufón, humorista, paya so. el. 1. mmetyi, pret. v. o mmetta ; ne e húbbé cogí al ladrón. mmi, pret. v. o mma ; n - obo''ó me puse de pie, to - obo''ó nos pusimos de pie. mmia, v. paralizar, parar; to la - e elako nosotros paramos el trabajo. mmiesiia, pret. v. o rnmia ; lo e bilabba vosotros paraliza bais los asuntos, ba - o motóo ellos paraban el coche. mmiia, pret. v. o mmia ; e kobin na a - e bilako el gobierno paró los trabajos', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('mmo', 's.', NULL, NULL, NULL, NULL, 'sing. demonio, diablo, fantasma. difunto. el. I ; na - na botyo a heye a beUá né demonio o persona, que seque mis lágrimas, o - la morada de los demonios. mmOla, v. preparar; to la ba - o nos estamos preparando. Pret. mmo ri, mmolessi. mmOlessi, pret. v. o mmola ; n la - a lokko yo preparaba las cosas. Tb. uoless;. mmora, v. preparar, prepararse; n ba - o me preparé. efr. o mmola. mmori, pret. v. o rnmOla ; n-e bilab ba preparé los asuntos, los hechos. ', NULL, 'o uolla', 'Fuente: bubi-español', 'import-script');

