  ('mORye', 's.', NULL, NULL, NULL, NULL, 'sing. dedo, yema del dedo. el. 3. Tb. bOne, bOnaai. Moña, antrop. que parece una forma abre viada de Monyá''ola. Se localiza en Belebú. Moñai, antrop. formado a partir del verbo o nya ''a. En bubi Monyaí ofrece el mismo significado que Mna ''í. Se localiza en Moeri', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
