  ('Mosari', 'antrop.', NULL, NULL, NULL, NULL, 'que debería escribirse Mosari. Está localizado en Riaba, en Batete y en Moka', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('mosibé', 's.', NULL, NULL, NULL, NULL, 'sing. persona natural de Lubá. el. l. Mosochi, antrop. que debería escribirse Mosotyi. Se localiza en Moka', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mosibé', 'antrop.', NULL, NULL, NULL, NULL, 'obtenido a partir del préstamo bubinizado wásibé. Mosibé es la persona que vive en la bahía del Oeste o San Carlos. Se localiza en Ruiché', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
