  ('mososó', 's.', NULL, NULL, NULL, NULL, 'sing. malanga. pezón. el. 3', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mososó', 'antrop.', NULL, NULL, NULL, NULL, 'que debería escribirse Mososó. También signifi ca "malanga" y "pezón". Para ambos casos se escribirá Mososó. Se localiza en Batete', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('mosotyi', 's.', NULL, NULL, NULL, NULL, 'sing. rayo. el. 3. Tb. bOsotyi', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('mossú', 's.', NULL, NULL, NULL, NULL, 'sing. dedo del pie. el. 3. T b. bOnessú. Mosupi, ant r op. compuesto por los términos mmo y suppíi. Mmosúppi significará "persona elegida por el espíritu". Se localiza en Moka', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mota', 'antrop.', NULL, NULL, NULL, NULL, 'que debería escribirse Moota. Moota se refiere a Mpeyo / 237 la persona que trenza. Se localiza en Sampaka', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('mOtallo', 's.', NULL, NULL, NULL, NULL, 'sing. medicamento, remedio. el. 3. Tb. bOlallo, meressi. Molay, antrop. probablemente prestado de alguna lengua africana, aunque su parecido con Moláe nos permite incluirlo entre los términos bubis. Se localiza en Baresó', NULL, NULL, 'Fuente: bubi-español', 'import-script');

