  ('MouJe', 'antrop.', NULL, NULL, NULL, NULL, 'que nos remite a Moula. Se loca liza también en Belebú. mpá, 1. v. coger, echar, observar; o - sibbó echar una miradita, tener en cuenta; o - kotto dar un paso rítmico, avanzar; o - boatta contar una noticia; o - etataa disparar una escopeta. Pret. mpí, mpessi. 2. s. pI. pulseras o brazaletes hechos con sartas de t yíbO. el. 8. Tb. ippá', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mpá', 'antrop.', NULL, NULL, NULL, NULL, 'que hace referencia a las pulseras o brazaletes hechos con sartas de tyíbO. Se localiza en Baney y en Rebola. mpáám, pret. v. o mpálla ; n-a batyo Matta conté una historia a las personas, o - a banapa na bisOí contaste mentiras a los estudiantes, etc. Mpachí, antrop. que nos remite a opatyí. Se localiza en Belebú. mpáJessi, pret. v. o mpálla ; aossa Bososso o - o boatta antaño se hablaba de Bososo como noticia. mpálIa, v. contar, narrar, hablar de; o boitta a la e - bisijí. Pret. mpáám, mpálessi', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('mpanapénne', 's.', NULL, NULL, NULL, NULL, 'pi. piñas, ananás. el. 8', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('mpapara', 's.', NULL, NULL, NULL, NULL, 'pi. desmontes, desbroces. el. 8', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('mpári', 'adv.', NULL, NULL, NULL, NULL, 'ayer; to seí ripotto ayer estuvimos en la ciudad. mpeem, pret. v. o mpella ; e enokonokko e - o botyo emaókoro el ogro lanzó a la persona un mango', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mpele', 'antrop.', NULL, NULL, NULL, NULL, 'obtenido a partir de pellé. Se refiere al "ladrón" o a la "persona des honesta e impúdica". Mpelé se localiza en Belebú. mpeJessi, pret. v. o mpella ; e nooa e - o botyo tuái la serpiente lanzaba sali va a la persona. mpella, v. lanzar algo a alguien, dar la bendi ción; o botéribbo a la - o obitábítta o bohullá el espíritu da la bendición al guerrero. Pret. mpeem, mpelessi. mperá. conj. con tal de; - o to''óri e ette con tal de que digas la verdad', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mpesó', 'antrop.', NULL, NULL, NULL, NULL, 'que debería escribirse Mpessó. Se localiza en Basuala. mpessi, pret. v. o mpá ; to - sibbó echábamos una mirada. mpessó, 1. s. sing. adoquinado. carretera. plaza. tarima. lugar elevado. 2. antrop. lugar elevado, algo que destaca. el. 3', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Mpeyo', 'antrop.', NULL, NULL, NULL, NULL, 'obtenido a partir del verbo o páa. Mpéyo se traducirá por "me han regalado algo". Se localiza en Rebola. 238 / mpí mpí, pret. v. o mpá ; a banánna ba - kotto las abuelas dieron un paso rítmico, avanzaron', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('mpilla', 's.', NULL, NULL, NULL, NULL, 'pi. golpes en la espalda. CL 8', NULL, 'ipilla', 'Fuente: bubi-español', 'import-script'),
  ('mpo', 's.', NULL, NULL, NULL, NULL, 'sing. y pi. faena, tarea, trabajo, ocupación, deber, obligación, etc. Clases 9 y 10', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('mpOlo', 's.', NULL, NULL, NULL, NULL, 'pi. gestos, ademanes. CI. 8', NULL, 'ipolo', 'Fuente: bubi-español', 'import-script');

