  ('Muatetema', 'antrop.', NULL, NULL, NULL, NULL, 'compuesto por el verbo o átta y el sustantivo etémá. Muatéetémá se puede traducir por "rompecorazón". Se localiza en Batete, en Moka y en Ruiché', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
