  ('nappa', 's.', NULL, NULL, NULL, NULL, 'sing. y pi. cuchillo podador. Cls. 9 y 10. nappá, v. mamar; e sine''e si lá - el bebé mama. Pret. nappí, napéssí. nappí, pret. v. o nappá ; 010 botyo ata abelle roló botSo ata náppi abelle] esta persona no ha mamado leche materna. nappiá, v. amamantar; e póríi karí e lá - e sipóríi la cabra amamanta al cabrito. Pret. napía, napiésiia. naríbba, v. dispersarse; o tonorí to lá - la e ekokoo e etataa los pájaros se dispersan con el disparo de la escopeta. Pret. naríbbi, naríbessi. naríbbi, pret. v. o naríbba ; a batyo bammaa ba - todas las personas se dispersaron. naríbessi, pre/. v. o naríbba ; a batyo ba mmaa ba - todas las personas se dispersaban, o tonorí álle to - los pájaros también se dispersaban. naríbia, v. ahuyentar, espantar. disper sar ; e ekukuu e lá - a batyo el trueno espanta a las personas. Pret. naríbiia, naríbiesiia. naríbiesiia, pret. v. o naríbia ; a bollá ba - e besoppé los niños espantaban a las ardillas. naríbiia, pret. v. o naríbia ; a bOllá ba - i ko''e los niños esp', NULL, 'o áppa', 'Fuente: bubi-español', 'import-script'),
  ('narnrno', 's.', NULL, NULL, NULL, NULL, 'sing. y pi. dátil de la palmera de acei te. Cls. 9 y 10. Tb. pi/lá. nánáa, v. enganchar, enredar; to la - e riotté nosotros enredamos la red. Pret. náníi, nánéssi', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('natta', 's.', NULL, NULL, NULL, NULL, 'sing. y pi. biznieto. Cls. 9 y 10. nawera, v. remar; a baobbe ba lá - la e benne be ábo los pescadores reman con sus dedos. Pret. naweria, naweresiia. naweresiia, pret. v. o nawera ; tue ammaa to - la e pullá todos nosotros remábamos con el huracán. naweria, pret. v. o nawera ; a batyo ba la e pullá las perso nas remaron con el huracán. Nchana, antrop. formado a partir de la expresión n tyá na ''u. Ntyána se loca liza en BOS080. Nchaso, an/rop. construido a partir de la expresión n tyá soou. Debería escri nekku / 241 birse Ntyasso. Se localiza en Basakato de la Sagrada Familia', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Ndele', 'antrop.', NULL, NULL, NULL, NULL, 'que significa "camino", "sendero". Ndele se localiza en Moka. ne, 1. prl!f suj. yo. 2. formo verbo soy, estoy; botyo soy una persona, - hállo estoy aquí. né, mor:[. mi, mío. contracción del sufijo posesi vo -ro y el morfema é; o botyo - mi pariente, o bOllá - mi hijo, a bellá - mis lágrimas. Tb. -rí, -nyí', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('ne''í', 'S.', NULL, NULL, NULL, NULL, 'sing. y pI. berenjena, tomate. Cls. 9 y \O', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nebba', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. nieve. Cls. 9 y 10', NULL, 'pako pako', 'Fuente: bubi-español', 'import-script'),
  ('nebba', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. iguana, reptil comestible. Cls. 9 y \O. nebba, V. despertar a alguien; we le nebbe no me despiertes. Pret. nebbi, nebessi. nebbi, pret. V. o nebba ; n-e kario''e yo desperté a la gallina, o - o wéso''o o tú despertaste a tu amigo, a le - él/ella me despertó, to - desperta mos, \O bO - vosotros le despertasteis, ba e - ellos nos despertaron. nebea, v. despertarse, levantarse; a batyo ba Já - la e nokonoko la gente se despierta con el ruido. Pret. nebei, nebieseei. nebei, pret. V. o nebea ; n- la e nokonoko me desperté con el ruido. lb. ebei. nebessi, pret. V. o nebba ; n o oberíi ro wáae na á''a wéi yo despertaba a mi madre pero había muerto. nebieseei, pret. v. o nebea ; a baitta ba - la o loé \O a batyo bá e tyélle los altos dig natarios se despertaban con los lloros de las per sonas de la cárcel. lb. ebieseei. nebiilea, V. estirarse, desentumecer; e puá e lá - e ebari el perro se estira por la mañana. Pret. nebolei, nebOleseei. nebiilei, pret. v. o nebolea ; a batyo ba - las', NULL, 'o ebba', 'Fuente: bubi-español', 'import-script'),
  ('Neka', 'antrop.', NULL, NULL, NULL, NULL, 'obtenido a partir del verbo o neka. Se localiza en Baney. nekekessi, pret. V. o nekekka ; a bayolla ba áó ba tá - ba sessi la i pohá i ábo nuestros abuelos no dudaban cuando rea lizaban sus hazañas. nekekia, V. aflojar, debilitar; to la - e eta póllo nosotros aflojamos la lona. Pret. nekekiia, nekekiesiia. nekekiesiia, pret. V. o nekekia ; n bo - ii biisiirí ro yo aflojaba mi cordón. nekekiia, pret. V. o nekekia ; n e - e etapóllo yo aflojé la lona, o bi - e bitapóllo tú aflojaste las lonas, a bo - o bOsorí él/ella aflojó el cordón, to - noso tro� aflojamos, \O - vosotros aflojasteis, ba - ellos/ellas aflojaron. nekekka, V. dudar, titubear; tyommaa o bulabotyo tyi - jamás duda un defensor. Pret. nekekki, nekekessi. nekekki, pret. V. o nekekka ; n ta - Ieláe no dudé ni un ápice', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nekku', 'S.', NULL, NULL, NULL, NULL, 'pI. verduras amargas. hierba moras. CI. 10. Tb. na ''u. 242 / nélaam nélaam, pret. v. o nélalla ; to o bosekke nosotros clava mos la tabla de madera, to bo - lo clavamos. nélalessi, pret. v. o nélalla ; o bobáa i tyóbbo a - o bosekke el hacedor de las casas clava ba la tabla de madera. nélalla, v. clavar, crucificar; e kapinta e lá o bosekke el carpintero clava la tabla de madera. Pret. nélaam, nélalessi', NULL, 'o nettá', 'Fuente: bubi-español', 'import-script'),
  ('nellá', 'adj.', NULL, NULL, NULL, NULL, 'indo otro, otra, otros, otras. Concuerda con las palabras de las Cls. 9 y 10; nabba - otro animal, otra carne, kollo - otras sardinas. nélOlessi, pret. v. o nélolla ; to - e tyal lá nosotros desclavábamos la chapa de zinc. nélolla, V. desclavar; e kapióta e lá - e tyallá el carpintero des clava la chapa de cinc. Pret. nélori, nélolessi. nélOri, pret. V. o nélolla ; e besekke m be - las tablas de madera las desclavé', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nene', 'adj.', NULL, NULL, NULL, NULL, 'bello, hermoso, bonito, agradable. Con cuerda con las palabras de las Cls. 9 y 10 ; e nabba - un hermoso animal, i bappa - unas bonitas serpientes', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Nepi', 'antrop.', NULL, NULL, NULL, NULL, 'que debería escribirse Neppí. Se localiza en Baney', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('neppí', 'S.', NULL, NULL, NULL, NULL, 'sing. y pI. cantante, músico. Cls. 9 y 10', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('neppó', 'S.', NULL, NULL, NULL, NULL, 'sing. y pI. sobrino, el hijo de la herma na. Cls. 9 y 10', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('néri', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. clavo. Cls. 9 y 10', NULL, 'tokko', 'Fuente: bubi-español', 'import-script'),
  ('Neta', 'antrop.', NULL, NULL, NULL, NULL, 'que parece provenir del verbo o net tá. Se localiza en Baney. netessi, pret. V. o nettá ; n-e biho''o lÍl yo clavaba mis postes. Tb. né/alessi. nettá, v. clavar, incrustar; i kapinta kubbaa i lá - ollé todos los carpinteros clavan algo. Pret. netyí, netéssi. T b. o nélalla. netyí, pret. V. o nettá ; n- o bosekke yo clavé la tabla de madera, o - o lo''obbá e ello wela tú incrustaste el cuchillo en el ñame, a - e kurússu él/ella clavó la cruz, to - a baallá ba áí nosotros clavamos sus manos, 10 - clavasteis, ba - clavaron. Tb. o né/ori', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Nikobara', 'antrop.', NULL, NULL, NULL, NULL, 'obtenido a partir del verbo o nokObáára. Se refiere a alguien que traga sin masticar mucho. Se localiza en Baney. Njuhaleri, antrop. que debería escri birse Nhuáaleri. Se localiza en Riaba', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nkobbe', 's.', NULL, NULL, 'Cl. 5', NULL, 'sing. árbol del plátano. . Tb. rikobbe', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nkuáaó', 'adv.', NULL, NULL, NULL, NULL, 'ahora, en este momento; ne''a poes si - acabo de llegar ahora. Tb. tyútyulé, dyíto, lá/a, láolé, nkuáhoole', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nkuáhoole', 'adv.', NULL, NULL, NULL, NULL, 'ahora, ahora mismo, en este momento. Se localiza entre los usuarios de Baney. Tb. tyútyulé, dyíto, /ála, láolé, nkuáaó. nkutessi, pret. V. o nkutta ; n-me fastidiaba, o - te fastidiabas, a - se fastidiaba, to - nos fastidiábamos, 10 - os fastidiabais, ba - se fastidiaban. nkutta, v. fastidiarse, perder; ba lá - lello ellos/ellas se fastidian hoy. Pret. nkutyi, nkutessi. ukutya, V. fastidiar, hastiar, aprovecharse de alguien; e enokonokko e lá - o tonokonokko el ogro fastidia a los pequeños ogros. Pret. nkutyia, nku tyesia. nkutyesia, pret. V. o nkutya ; to bo - o bosubári nosotros nos aprove chábamos de la benjamina. nkutyi, pret. V. o nkutta ; n-me fas tidié, n ka - me he fastidiado. nkutyia, pret. v. o nkutya ; 10 le - me habéis fastidiado, os habéis aprovechado de mí', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nmollo', 's.', NULL, NULL, NULL, NULL, 'sing. y pI. aguja, alfiler grande. Cls. 9 y 10', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nná', 'S.', NULL, NULL, NULL, NULL, 'sing. y pI. espalda, dorso. Cls. 9 y 10 ; o herá e - lle var en la espalda, e - pua detrás, ao ? ¿qué tal?', NULL, 'hNná', 'Fuente: bubi-español', 'import-script'),
  ('nnabí''o', 'adv.', NULL, NULL, NULL, NULL, 'atrás, detrás, detrás de; pellá e siéntate por la parte de atrás', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('nnápua', 'adv.', NULL, NULL, 'Cl. 10', NULL, 'detrás; e - e eriia detrás del pueblo, a espaldas del pueblo. nne, moif. numo cuatro. Concuerda con las pala bras de la ; nabba yé - cuatro animales. nokkó / 243 nné, 1. morj: numo uno. Concuerda con las pala bras de la ; eriia é - un poblado. 2. prono sing. otro, otra. Concuerda con las palabras de la CL 7; elo eriia, e - este pueblo, el otro. úne, prono yo ; - ne bOllá yo soy un niño', NULL, NULL, 'Fuente: bubi-español', 'import-script');

