  ('Ntere', 'antrop.', NULL, NULL, NULL, NULL, 'construido a partir de la expresión n te ri. Ntere se localiza en Basaka to de la Sagrada Familia. nteseei, pret. v. o ntéa ; o bukká bo. ntesei, pret. v. o nti�a ; e biséné bi - las pequeñas ardillas se limpiaban el ano. ntessi, pret. v. o nta ; n-o bollá yo limpiaba el ano del niño. ntessi, pret. v. o ntá ; a batyo ba - i pi''í las personas obstruían los agujeros. Mora, v. dañar, hacer daño en una herida; o la le ótora me haces daño en la herida, we le ótore no me hagas daño en la herida. Pret. ntoriia, IÍto resiia. I Ítoresiia, pret. v. o IÍtora ; bOlo boatta bo - a batyo bammaa esta noticia dañaba a todas las personas. I ÍtOriia, pret. v. o ntora ; n bO - o bOllá dañé al niño. ntyi, pret. v. o nta ; n-o bollá limpié el ano del niño. ntyí, pret. v. o ntá ; a baoppo ba - o bukká el aluvión obs truyó el agujero', NULL, 'o itóra', 'Fuente: bubi-español', 'import-script'),
