  ('okokue', 's.', NULL, NULL, 'Cl. 3', NULL, 'sing. 1. herbácea que forma matorrales de rizomas rastreros. 2. fruto de esta planta. . okólla, v. arrastrar, tirar de; o motóo bo lá - e rikotye el coche arrastra al camión. Pret. okóri, okuessi', NULL, 'niityonotyo', 'Fuente: bubi-español', 'import-script'),
