  ('okoputtú', 's.', NULL, NULL, 'Cl. 7', NULL, 'sing. enjambre. . Tb. opuputtu. okórea, v. arrastrarse; e esokolla e lá el ciempiés se arrastra. Pret. okórei, okóreseei. okórei, pret. v. o okórea ; a bollá ba - e telle wela los niños se arrastraron en el camino. okóreseei, pret. v. o okórea; e bilabba bi - la e ribOtyo las cosas se arrastraban con el tiempo. okóri, pret. v. o okólla ; n ri - e raatyé yo arrastré la cama, n - e raatyé arrastré la cama', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('okoríbba', 's.', NULL, NULL, 'Cl. 7', NULL, 'sing. lago, pantano. . okosessi, pret. v. o okossa ; mpári to Iíkelíke ayer nos movíamos mucho. okossa, v. moverse; e pókkó e tóppi o é e lá - ókuáaó el buey que está atado se mueve ahora. Pret. okossi, okosessi. okossi, pret. v. o okossa ; o botté bo lobbó el árbol se movió mucho. okuelessi, pret. v. o okuella ; n - yo arrancaba de cua jo, bo - tú arrancabas de cuajo, a él arrancaba de cuajo, to - nosotros arrancábamos de cuajo, 10 - vosotros arrancabais de cuajo, ba - ellos arrancaban de cuajo. okuella, v. desarraigar, arrancar. Pret. okueri, okuelessi; n la - e biruppú yo arranco de cuajo las hierbas. okuerl, pret. v. o okuella ; n - i to lÍ1 yo arranqué de cuajo mis plantas de ñame. okuessi, pret. v. o okólla ; a batyo bammaa ba - e rikotye todas las personas tiraban del camión', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('Olá', 'antrop.', NULL, NULL, NULL, NULL, 'que deberia escribirse Eiilá. Se refiere al personaje mitológico eolá mo tokape. Se localiza en Baney. OIálessi, pret. v. o olálla ; mpári to ba - o ayer nos matábamos. OIálla, v. matarse, batallar, pegarse, combatir, pelear; to la ba - o nos estarnos pegando. Pret. olám, olálessi. OIám, pret. v. o olálla ; i ko''e i ba - los gallos se mataron', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('olé', 'adj.', NULL, NULL, 'Cl. 1', NULL, 'dem. aquel, aquella. Concuerda con los nombres de la ; - boyolla aquel abuelo, - bonánna aquella abuela. olelessi, pret. v. o olella ; bolo botté n bo - o bolotyi este palo se lo llevaba al guardián. OIelessi, pret. v. o olella ; o bonán na lÍ1 n bo - tyué o rótta a mi abuela le compraba pesca do en el mercado. OIelessi, pret. v. o Olella ; o bulla á e eriia n bo - bihalle a la donceUa del pueblo le mataba arenques, ne - e elako lÍ1 ene olelessi eelakóóm] yo maduraba mi trabajo. olella, v. llevar para alguien; to la - bOllá barí bombebbí nosotros llevamos muñecas a las chicas, o wetta áí a la bo - ripéppa su hermana le lleva un documento. Pret. ole ri, olelessi. OIella, v. comprar para; o buityü lÍ1 n la bo ribúkku a mi hermanito le compro un libro. Pret. oleri, olelessi. OIella, v. matar para alguien, madurar algo; o boebba a la - e elako el vinatero madura el trabajo. Pret. ole ri, olelessi. olerl, pret. v. o oleUa ; mpári to no - abúkku ayer os llevamos libros. OIerl, pret. v. o Ole', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('olió', 's.', NULL, NULL, 'Cl. 7', NULL, 'sing. dátil verde e inmaduro. racimo verde de dátiles. ; na ó uperi o - we e okke si te lanzan un racimo verde de dátiles no lo cojas', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('ollé', 's.', NULL, NULL, 'Cl. 7', NULL, 'sing. algo, objeto, cosa, materia. ; na - e ta okkí boréi e lá bolla si algo no tiene comensal se pudre. Tb. eollé', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('ólló', 's.', NULL, NULL, 'Cl. 1', NULL, 'sing. ofensa. CI. 7 ; o le mpeem - me has ofendido. 010, adj. dem. ese, esa. Concuerda con las palabras de la CI. 1 1; - loribáa ese pelo. 010, adj. dem. este, esta. Concuerda con los nom bres de la ; - bOyolla este abuelo. OIólló, temo a4i. viejo, veterano. Se pospone a los morfemas concordantes de las Clases a las que hace referencia: CI. I botyo b - persona vieja/mayor. CI. 3 bokutta b - vieja manta. CI. 5 ripotto r - vieja ciudad. CI. 7 esussa - viejo zorro. Cls. 9 y 10 eti ke''u k - vieja suciedad. CI. I I loetto 1-antigua caminata. settya s vieja cabañita. CI. 16 habba h - un viejo lugar. CI. 6b labba 1 - viejo asunto. batyo b veteranas personas. CI. 4 beatta be - viejas his torias. CI. 6 apotto b - viejas ciudades. biriia bi - viejos poblados. CI. 13 to''ú t - viejas fuerzas, etc', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('ometya', 's.', NULL, NULL, 'Cl. 2', NULL, 'sing. bufón, cómico, humorista, paya so. CI. l', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('ommo', 's.', NULL, NULL, 'Cl. 3', NULL, 'sing. más allá, morada de espíritus. ', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('onná', 'adv.', NULL, NULL, NULL, NULL, '1. el lado derecho mirando al mar. 2. oeste. 0000, adv. abajo, en el suelo. ooootyé, l. adv. en el suelo, abajo; n tyí obo''ó n tyí - n ka tyiáán bulé no estoy ni arriba ni abajo, me he quedado solo. 2. excl. hacia abajo. Se utiliza como expresión para animar a quien baila flexio nando las piernas bailando hasta el punto de sen tarse en el suelo: ionnotyéeeé! 3. bajo vientre, genitales. 00, adj. dem. ese, esa. Concuerda con las palabras de la CI. 1; - botyo esa persona. ooa, v. rechazar, odiar; we le ooe no me odies. Pret. ooi, oessi. Tb. o /cooa. ooa, v. lavar, bañar; o la - a bello o tú lavas tus dientes. Pret. ooi, oessi. ooi, pret. v. o ooa ; ii Mitta a tyí''a - a bakoé el gober nador no odió a los braceros. Tb. /cooi. ooi, pret. v. o ooa ; n - ii bOllá yo lavé/bañé al niño, ii bollá n bii - al niño le lavé/bañé. oom, pret. v. o olláa ; e nah ba ne - al animal lo maté', NULL, 'anno', 'Fuente: bubi-español', 'import-script'),
  ('opakara', 'adj.', NULL, NULL, 'Cl. 1', NULL, 'sing. tunante, pillo. . opiesiia / 257 opálessi, pret. v. o opálla ; IÍlmalé o bue''iáa - a bakuerakueráa bosuisuií antaño el maestro pegaba a los alumnos con un látigo. ópálessi, pret. v. o ópálla ; n - yo golpeaba con, bo tú golpeabas con, o - él golpeaba con, to - nosotros golpeába mos con, 10 - vosotros golpeabais, ba - ellos golpeaban con. opálla, v. azotar/pegar con; o bokuerakueráa a la óppa botyo, a la M - ribúkku el alumno pega a alguien, le pega con un libro. Pret. opári, opálessi. ópálla, v. golpear con, agredir; 010 botyo n la bo - e ette a esta persona le agredo con la verdad. anunciar. Pret. ópám, ópálessi', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('opalláa', 's.', NULL, NULL, NULL, NULL, 'sing. canasta, cesta grande. barreño. el. 3. ópám, pret. v. o ópálla ; e puá lÍl ne - eparakátta a mi perro lo golpeé con una alpargata', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('opanári', 's.', NULL, NULL, NULL, NULL, 'sing. mujer española. el. 1', NULL, NULL, 'Fuente: bubi-español', 'import-script'),
  ('opanná', 's.', NULL, NULL, NULL, NULL, 'sing. hombre español. el. 1. opári, pret. v. o opálla ; o Mtyo bullé n bo - o we''em a la otra persona le pequé con mi boca', NULL, NULL, 'Fuente: bubi-español', 'import-script');

